import React from 'react';
import RoomCard from './RoomCard';
import rooms from '../data/roomsData';

const RoomsList = () => {
    return (
        <div className="rooms-list">
            {rooms.map((room) => (
                <RoomCard key={room.id} room={room} />
            ))}
        </div>
    );
};

export default RoomsList;
